import React,{memo} from "react";
import { PropTypes } from "prop-types";
import {Card as CardUI} from '../../../reactComponents/card/Card';
import {
    LabelStyle,
    ValueStyle,
    CardComtentStayle
} from '../../../views/Main/style'
function Card({value,label,color}){
    return(
        <CardUI>
        <CardComtentStayle  color={color}>
        <ValueStyle>{value}</ValueStyle>
        <LabelStyle>{label}</LabelStyle>
        </CardComtentStayle>
        </CardUI>
    )
}
export default memo(Card)
